  profile: {
    user: { _id, name, avatar },
    bio,
    interests
  }
}) => {
  return (
    <div className='profile bg-light'>
      <img src={avatar} alt='' className='round-img'></img>
    </div>
  );
};

ProfileItem.propTypes = {
  profile: PropTypes.object.isRequired
